/** instagram username */
export declare type username = string;
/** instagram password */
export declare type password = string;
/** sessionid from cookie */
export declare type session_id = string;
/** instagram post url can be post, reel, tv */
export declare type url = string;
/** Media Type */
export declare type MediaType = 'video' | 'image';
/** Mime Type */
export declare enum MimeType {
    'image/jpeg' = 0,
    'image/png' = 1,
    'video/mp4' = 2,
    'video/gif' = 3
}
/** csrf token */
export declare type csrfToken = string;
/** instagram post type */
export declare type postType = 'p' | 'reel' | 'tv';
/** a formatted shortcode */
export interface formattedShortcode {
    type: postType | string;
    shortcode: string;
}
